import React, { Component } from "react";
import Project from "./project";
import { getAllProjects } from "../actions";

class Projects extends Component {
  constructor() {
    super();
    this.state = {
      projectList: []
    };
  }

  componentDidMount() {
    axios.defaults.baseURL = "https://randomuser.me/api";

    axios
      .get("/?results=5")
      .then(response => this.setState({ projectList: response.data.results }))
      .catch(err => {
        console.log(err);
      });
  }

  render() {
    return <Project projectList={this.state.projectList} />;
  }
}

export default Projects;
